import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";
import { Route, Routes } from "react-router-dom";

function App() {
  return (
    <>
      <Routes>
        <div className="App">
          <Route>
            <Navbar/>
            <Footer/>
            </Route>  
        </div>
      </Routes>  
    </>  
  );
}

export default App;
